const tintColorLight = '#2f95dc';
const tintColorDark = '#ffffff';

export default {
  light: {
    text: '#ffffff',
    background: '#00263A',
    tint: tintColorLight,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorLight,
  },
  dark: {
    text: '#ffffff',
    background: '#00263A',
    tint: tintColorDark,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorDark,
  },
};
